import { Component } from '@angular/core';
import { IOfficeAccessories } from './models/officeAccessoriesInterface'
import { officeAccessories as mydata } from './data/officeAccessories'

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html'
})
export class AppComponent {
  title = 'app';
  officeAccessories: IOfficeAccessories[] = mydata;
}
<body>
  <app-nav-menu></app-nav-menu>
  <main class="container">
    <router-outlet></router-outlet>
    <h1>Список канцелярии:</h1>
    <app-officeAccessories [officeAccessories]="officeAccessories[0]"></app-officeAccessories>
    <app-officeAccessories [officeAccessories]="officeAccessories[1]"></app-officeAccessories>
  </main>
</body>
